import React, { useState } from 'react';
import {
  Box,
  Typography,
  Checkbox,
  Slider,
  FormControlLabel,
  Paper,
  Grid,
  Card,
  CardContent,
  Radio,
  RadioGroup,
  Divider,
  Chip
} from '@mui/material';

interface Video {
  title: string;
  performance?: {
    views: string;
    likes: string;
    comments: string;
  };
}

interface ProductSelectionProps {
  videos: Video[];
  onProductSelect: (selection: any) => void;
}

const packages = [
  { name: 'BASIC 패키지', price: 100000 },
  { name: 'STANDARD 패키지', price: 200000 },
  { name: 'PREMIUM 패키지', price: 300000 },
  { name: 'VIP 패키지', price: 500000 },
];

const ProductSelection: React.FC<ProductSelectionProps> = ({ videos, onProductSelect }) => {
  const [selectedSubscriberPackage, setSelectedSubscriberPackage] = useState<string>('');
  const [selectedVideos, setSelectedVideos] = useState<{ [key: string]: boolean }>({});
  const [videoPackages, setVideoPackages] = useState<{ [key: string]: string }>({});
  const [customPrices, setCustomPrices] = useState<{ [key: string]: number }>({
    subscriber: 100000,
    video: 100000,
  });

  const handleVideoSelect = (videoTitle: string) => {
    setSelectedVideos(prev => ({
      ...prev,
      [videoTitle]: !prev[videoTitle]
    }));
  };

  const handlePackageSelect = (videoTitle: string, packageName: string) => {
    setVideoPackages(prev => ({
      ...prev,
      [videoTitle]: packageName
    }));
  };

  const handlePriceChange = (type: 'subscriber' | 'video', value: number) => {
    setCustomPrices(prev => ({
      ...prev,
      [type]: value
    }));
  };

  const getPerformanceColor = (level: string) => {
    switch (level) {
      case '우수': return 'primary';
      case '적정': return 'success';
      case '미달': return 'error';
      default: return 'default';
    }
  };

  return (
    <Box>
      {/* 구독자 단품 상품 */}
      <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
        <Typography variant="h6" gutterBottom>
          1. 구독자 수 증가 단품
        </Typography>
        <Box sx={{ mt: 2 }}>
          <Typography gutterBottom>구독자 수 증가 금액 설정</Typography>
          <Slider
            value={customPrices.subscriber}
            onChange={(_, value) => handlePriceChange('subscriber', value as number)}
            min={50000}
            max={1000000}
            step={10000}
            valueLabelDisplay="auto"
            valueLabelFormat={(value) => `₩${value.toLocaleString()}`}
            sx={{ width: '50%' }}
          />
        </Box>
      </Paper>

      {/* 영상별 패키지 상품 */}
      <Paper elevation={3} sx={{ p: 3 }}>
        <Typography variant="h6" gutterBottom>
          2. 영상별 패키지 선택
        </Typography>
        {videos.map((video, index) => (
          <Box key={index} sx={{ mb: 3 }}>
            <Grid container spacing={2} alignItems="center">
              <Grid item xs={12}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={selectedVideos[video.title] || false}
                      onChange={() => handleVideoSelect(video.title)}
                    />
                  }
                  label={video.title}
                />
              </Grid>
              {video.performance && (
                <Grid item xs={12}>
                  <Box sx={{ display: 'flex', gap: 1, ml: 4 }}>
                    <Chip 
                      label={`조회수: ${video.performance.views}`}
                      color={getPerformanceColor(video.performance.views)}
                      size="small"
                    />
                    <Chip 
                      label={`좋아요: ${video.performance.likes}`}
                      color={getPerformanceColor(video.performance.likes)}
                      size="small"
                    />
                    <Chip 
                      label={`댓글: ${video.performance.comments}`}
                      color={getPerformanceColor(video.performance.comments)}
                      size="small"
                    />
                  </Box>
                </Grid>
              )}
              {selectedVideos[video.title] && (
                <>
                  <Grid item xs={12}>
                    <Box sx={{ ml: 4 }}>
                      <RadioGroup
                        value={videoPackages[video.title] || ''}
                        onChange={(e) => handlePackageSelect(video.title, e.target.value)}
                      >
                        <Grid container spacing={2}>
                          {packages.map((pkg) => (
                            <Grid item xs={3} key={pkg.name}>
                              <Card variant="outlined">
                                <CardContent>
                                  <FormControlLabel
                                    value={pkg.name}
                                    control={<Radio />}
                                    label={
                                      <Box>
                                        <Typography variant="subtitle2">{pkg.name}</Typography>
                                        <Typography variant="body2" color="text.secondary">
                                          ₩{pkg.price.toLocaleString()}
                                        </Typography>
                                      </Box>
                                    }
                                  />
                                </CardContent>
                              </Card>
                            </Grid>
                          ))}
                        </Grid>
                      </RadioGroup>
                    </Box>
                  </Grid>
                  <Grid item xs={12}>
                    <Box sx={{ ml: 4, mt: 1 }}>
                      <Typography gutterBottom>맞춤 금액 설정</Typography>
                      <Slider
                        value={customPrices.video}
                        onChange={(_, value) => handlePriceChange('video', value as number)}
                        min={50000}
                        max={1000000}
                        step={10000}
                        valueLabelDisplay="auto"
                        valueLabelFormat={(value) => `₩${value.toLocaleString()}`}
                        sx={{ width: '50%' }}
                      />
                    </Box>
                  </Grid>
                </>
              )}
            </Grid>
            {index < videos.length - 1 && <Divider sx={{ my: 2 }} />}
          </Box>
        ))}
      </Paper>
    </Box>
  );
};

export default ProductSelection;
